import React from 'react';
import './Navbar.scss';

const Navbar = (props) => {

    return(
        <nav className='main-nav'>
            <div className="logo">
            <img src="images/pushfit-logo.svg" alt="pushfit" className="main-logo"></img>
            <span>pushFIT</span>
            </div>
           <ul className="navbar-list">
               <li className="navbar-list-item focus-nav-icon" onClick={() => {props.toggle('Home'); props.toggle('PushFitApp')}}>Get Started</li>
               <li className="navbar-list-item"><a href="#">about</a></li>
               <li className="navbar-list-item"><a href="#">help</a></li>
           </ul>
        </nav>
    )
}

export default Navbar
